import {useEffect, useState} from 'react';
import {useNavigate} from 'react-router-dom';
import './App.css';

const baseUrl = "http://localhost:5000"

export function Login(){

	const navigate = useNavigate();

	const handleTake = () => {
		navigate('/quizList')
	};

	const handleCreate = () => {
		navigate('/createQuiz')
	};

	const handleEdit = () => {
		navigate('/edit')
	};

	const handleSend = () => {
		navigate('/send')
	};

	const handleInbox = () => {
		navigate('/inbox')
	};

	const handleLogin = () => {
		navigate('/login')
	};

	return (
	<div className="App">
    <body>
		<h1>Quiz!</h1>
		<div class = "menu">
			<h2>Menu</h2>
			<button type="button" onClick={handleTake} className="submit">
				Take a Quiz
			</button>
			<button type="button" onClick={handleCreate} className="submit">
				Create a Quiz
			</button>
			<button type="button" onClick={handleEdit} className="submit">
				Edit Quiz
			</button>
			<button type="button" onClick={handleSend} className="submit">
				Send
			</button>
            <button type="button" onClick={handleInbox} className="submit">
				Inbox
			</button>
			<button type="button" onClick={handleLogin} className="submit">
				Back to Login
			</button>
		</div>
	</body>
	</div>
	);
}
